        document.title = `Chats(${stateVariable})`
    })  
    
    return (
        <>
            <div className="center_div">
                <p>{stateVariable}</p>
                <div className="button2" onClick={() => functionUpdate(stateVariable + 1)}>
                    <span></span>
                    <span></span>
                    <span></span>
                    <span></span>
                    INCR
                </div>
            </div>
        </>
    )
}

